import GetData from "./components/GetData";
import { Routes, Route } from "react-router-dom"
import DisplayInfo from "./components/DisplayInfo";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<GetData />} />
        <Route path="/description" element={<DisplayInfo/>}/>
      </Routes>
    </div>
  );
}

export default App;
